import s from './Header.module.css';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <div className={s.container}>
            <div className={s.menu}>
                <nav>
                    <ul>
                        <li>
                            <Link>Characters</Link>
                            <Link>About</Link>
                            <Link>Blog</Link>
                            <Link>Contact</Link>
                        </li>
                    </ul>
                </nav>
            </div>
            <div className={s.logo}>2</div>
            <div className={s.contacts}>3</div>
            <div className={s.user}>4</div>
            <div className={s.search}>5</div>
        </div>
    );
}

export default Header;
